import React, { useState, useEffect } from 'react';
import './Feed.css'

const Feed: React.FC = () => {
  const [data, setData] = useState({});

  useEffect(() => {
    fetch('http://localhost:8080/init')
      .then(response => response.json())
      .then(data => setData(data));
  }, []);

  return (
    <div className="feed">
      {/* Add your Feed content here */}
      {data.titles && data.titles.map((title, index) => (
        <button key={index}>
          <div>Rating: {data.ratings[index]}</div>
          <div>Date: {data.dates[index]}</div>
          <div>Title: {title}</div>
          <div>Summary: {data.summaries[index]}</div>
        </button>
      ))}
    </div>
  );
};

export default Feed;
